import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Menu from "./Menu";
import FormCard from "./FormCard";


function Marco() {
  return (
    <Container>
      <Menu />
      <Row className="p-1">
        <Col>
          <FormCard />
        </Col>
      </Row>
    </Container>
  );
}

export default Marco;
